@infinite・6 we will push a significant update on Tuesday next week which will entail **restructuring our event generation system by moving the event generation entirely on our backend**. This will ensure consistency across validators regarding the event sets. And allow us to control the distribution of events resolutions. 

We will also push a small update to the scoring system which will ensure that **newly regged miners are not overly penalised by events for which they could not submit a prediction**.
We also decided to **keep the Brier scoring rule** due to its wide use across benchmarks (we will just delete the max component in the scoring). The next main scoring update will hence be the batching component.

