@infinite・6 **We will release our new validator architecture by January 2nd. **It will unlock **true event scalability** for the subnet as well as better resource utilisation, **allowing us to generate 1000+ events per day** and easily increase from there. Joining a diagram of the new architecture.

We are also from this week **gradually deploying to production our complete LLM event generation and resolution pipeline**. We will be streaming 100 LLM events per day within the next 2 weeks.

Importantly, from tomorrow **we will remove all the Azuro events on the subnet and add stricter filters on Polymarket events**, diminishing their generation rate. We want to focus entirely on prediction market events and our new synthetic events. We will introduce qualitative sport related forecasting through our LLM pipeline.

@infinite・6  we just released a new version of the validator code, please update asap if you are a validator. We will be bumping weights as usual on Thursday morning EST. 

**Release notes**: 

- **Events Resolution**: Events resolution and deletion upgraded to batched requests to improve overhead and reduce resolution time.

@infinite・6  

